import React from 'react'
import './styles/Post.css'
import merc from './merc.jpg'

export default function Post() {
  return (
    <div className='PostLayout'>
      <img src={merc} style={{maxWidth: '100%'}}></img>

      <p style={{overflow: 'auto'}}>The Mercedes-Benz C-Class has 1 Diesel Engine and 1 Petrol Engine on offer. The Diesel engine is 1993 cc while the Petrol engine is 1496 cc . It is available with Automatic transmission.Depending upon the variant and fuel type the C-Class has a mileage of 23.0 kmpl . The C-Class is a 5 seater 4 cylinder car and has length of 4793mm, width of 2033mm and a wheelbase of 2865mm.</p>
    </div>
  )
}
